const MenuItem = ({className, menu}) => {
  const {target, data} = menu

  return (
    <li className={`${className}__item`}>
      <button 
        data-btn="menu" 
        data-target={target}
      >
        <span>{menu.data}</span>
      </button>
    </li>
  )
}

export default MenuItem
